import React from 'react'
import '../../pages/style.css';
import { Container, Row, Col } from 'react-bootstrap'
import {
  AiFillGithub,
  AiOutlineTwitter,
  AiFillInstagram,
} from "react-icons/ai";
import { FaLinkedinIn } from "react-icons/fa";

function Home() {
  return (
    <div className='homepagebackground'>
      <Container>
        <Row>
          <Col md={7}>
            <h2 className='headtext'>Hey <span className='wave'>ðŸ‘‹ </span></h2>
            <h2 className='nametext'>I'm Sonu </h2>
            <h1 className='nametext'>I am a second year CS PhD Student at Colorado State University working in the area of computer vision and graphics. Currently I am advised by Nate Blanchard. Before my PhD I completed my Masters in Computer Engineering under the guidance of Ross Beveridge. My areas of interest include Virtual Reality, Human Digitization, AI at home and AI for fighting climate change.</h1>
            <span></span>
            <button onClick={() => {
              window.open("https://github.com/rahulvijay81");
            }}
              className='socailmediabtn'><AiFillGithub className='icon' /></button>
            <button onClick={() => {
              window.open("https://www.linkedin.com/in/rahulvijay81/");
            }}
              className='socailmediabtn'><FaLinkedinIn className='icon' /></button>
            <button onClick={() => {
              window.open("https://twitter.com/rahulvijay8156");
            }}
              className='socailmediabtn'><AiOutlineTwitter className='icon' /></button>
            <button onClick={() => {
              window.open("https://instagram.com/rahulvijay81");
            }}
              className='socailmediabtn'><AiFillInstagram className='icon' /></button>
          </Col>

          <Col md={5}>
            <div className="imagedeveloper">
            </div>
          </Col>
        </Row>
      </Container>
    </div>
  )
}

export default Home
